        var opens = __getJourneyPopoverOpensValue(journey);
        if (opens === 'down') {
            var placement = 'bottom';
            return placement;
        }
        if (opens === 'up') {
            var placement = 'top';
            return placement;
        }
        if (opens === 'right') {
            var placement = 'right';
            return placement;
        }
        if (opens === 'left') {
            var placement = 'left';
            return placement;
        }
