    var __nextTrailStop = function(journey, index) {
        var trailStop = journey.trail[index];
        if (trailStop === undefined) {
            __completeJourney(journey);
            return true;
        }
        if (index === 0) {
            __nextTrailStop(journey, index + 1);
            return false;
        }
        if (trailStop.pause === true) {
            __setTimeout(function() {
                trailStop.events.complete.apply(Sherpa, [journey, trailStop]);
                __nextTrailStop(journey, index + 1);
            }, trailStop.duration);
            return false;
        }
        try {
            var duration = Sherpa.hotspots.position(journey, trailStop);
        } catch (err) {
            __errorOutJourney(journey);
            return false;
        }
        __setTimeout(function() {
            __nextTrailStop(journey, index + 1);
        }, duration);
        return false;
    };

